import "./NavBar.scss";
import NavLogo from "../atoms/NavLogo/NavLogo";
import NavMenu from "../atoms/NavMenu/NavMenu";

const NavBar = () => {
    const navBarMenuItems = [
        {
            label: "Books",
            link: "/home"
        },
        {
            label: "Illustrations",
            link: "/illustrations"
        },
        {
            label: "Blog",
            link: "/blog"
        },
        {
            label: "About",
            link: "about"
        },
        {
            label: "Contact",
            link: "contact"
        }
    ];

    return (
        <nav className="nav-bar">
            <NavLogo />
            <NavMenu navBarMenuItems={navBarMenuItems} />
        </nav>
    );
};

export default NavBar;
